import React, { Component } from 'react';

import './App.css';
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import mainLogo from './images/ola_icon.jpeg';
const white_div = {
    backgroundColor: 'white',
    height: 'auto',
    width: '100%',
    position: 'relative',
    fontSize: 14,
    color: 'black',

    alignContent: 'left'



};

const div1 = {

    backgroundColor: "white",
    height: "auto",
    overflow: "auto",
    width: "100%"
};
const div3 = {
    float: "right",

    color: "white",
    margin: 23,
    height: "auto",
    width: "auto"
};

const div2 = {
    float: "left",

    color: "red",
    margin: 13,
    marginLeft: "60px",
    backgroundColor: "white",
    height: "auto",
    width: "auto",

}
const simple_header = {

    height: 'auto',
    width: '100%',
    position: 'relative',
    fontSize: 14,
    left: "5px",
    margin: "2px 10px 20px 10px",

    fontWeight: "bold",
    backgroundColor: "white",
    color: 'black',
    alignContent: 'left'


}
const content_left = {
    float: "left",

    textAlign: "center",
    backgroundColor: "#CDDC39",

    borderRadius: "15px",

    // margin: "5px",

    // marginRight: "10px",
    margin : "20px",
    color: "black",
    height: "auto",
    width: "15%"

}
const content_left_no_border = {
    float: "right",

    textAlign: "center",
    backgroundColor: "white",

    borderRadius: "15px",

    // margin: "5px",
    // marginRight: "10px",
    // marginLeft: "5px",



    textWeight: "bold",
    height: "auto",
    width: "33.33%"

}
const content_left_no_border_outstation = {
    float: "left",

    textAlign: "center",
    backgroundColor: "white",

    borderRadius: "15px",

    // margin: "5px 2px 5px 5px",
    // marginRight: "10px",



    textWeight: "bold",
    height: "auto",
    width: "33.33%"

}

class Newfile extends Component {


    render() {
        return (
            <div>
                <Carousel autoPlay infiniteLoop={true}>

                    <div style={{ width: "100%", height: "auto", display: "inline-block",alignContent:"left" }}>


                        <div style={simple_header}>
                        <a href="/"> <div style={content_left}>    <img src="https://cms-web.olacabs.com/00000000362.jpeg"></img>   CITY TAXI</div></a>
                        <a id="a1" href="https://www.olacabs.com/outstation">  <div style={content_left_no_border_outstation}> OUTSTATION</div></a>
                        <a id="a1" href="https://www.olacabs.com/rentals">  <div style={content_left_no_border} > RENTALS</div></a>
                    </div>
                    </div>
                    <div style={{ backgroundColor: "black", height: "auto", width: "100%" }}>

                    </div>

                    <div style={{ backgroundColor: "grey", height: "auto", width: "100%" }}>
                        <img src="http://lorempixel.com/output/cats-q-c-640-4807.jpg" alt="" />
                    </div>

                </Carousel>
            </div>
        );
    }
}

export default Newfile;
